22-летняя жительница Москвы получила травму ноги, когда пыталась пройти на территорию парка аттракционов.  Об этом сообщает "Интерфакс" со ссылкой представителя прессслужбы столичного главка МВД Андрея Галиакберова и его слова в пятницу вечером по московскому времени (20:30 мск). 
 По предварительным данным полиции столицы, девушка шла с подругой из ресторана домой после празднования своего дня рождения вместе c двумя мужчинами. 20 августа они пришли к парку развлечений под предлогом того что хотят посмотреть представление для детей - там должны были состояться танцы маленьких лебедей или дельфинов... но не успели зайти внутрь как попали во время представления прямо посреди сцены : одна нога девушки оказалась зажатой между сидениями двух кресел... она потеряла равновесие.... упала лицом вниз..схватившись за ногу мужчины начала кричать.... а затем стала звать мужчину который был рядом..... он подошел помочь ей встать...... женщина рассказала ему о том какая страшная травма у нее получена..........и добавила:-Я очень испугалась тогда................что я могла потерять сознание от падения..." [ далее ] ВИДЕО ДЛЯ РАЗМЕЩЕНИЯ СВОИХ КОММЕНТАРИЙ НА ФОТОКОНТЕ!!! http://video2youbiznes/?feature=player_embedded&srcid =1 &nbsp;
